import {GET_PRODUCTS} from '../actions/productActions'

const initialState = {
    products: [
        {
            id: 1, 
            title: "shirt", 
            price: 15.3,
            rating: 2, 
            imageUrl: "https://contents.mediadecathlon.com/p1484240/k$ab565f3675dbdd7e3c486175e2c16583/men-s-travel-trekking-shirt-travel100-warm-bordeaux.jpg?&f=800x800"
        },
        {
            id: 2, 
            title: "pants", 
            price: 12.3,
            rating: 5, 
            imageUrl: "https://www.helikon-tex.com/media/catalog/product/cache/4/image/9df78eab33525d08d6e5fb8d27136e95/s/p/sp-pgm-dc-11.jpg"
        }

    ]
};

export const productReducer = (state = initialState, action) => {
    switch (action.type) {
      case GET_PRODUCTS:
          state.products = action.products;
        return state;

      default:
        return state;
    }
  };
